import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';


function App() {
  return (
    <div>
      <h1 class="pt-5 pl-5">Hi, I'm Albert!</h1>
      <p class="subtitle">I'm a software engineer and hobbiest graphic designer.</p>
      <p>San Francisco Bay Area</p>
    </div>
  );
}

export default App;
